import React, { Fragment } from 'react';
import './App.css';
import Nav from './nav.jsx';
import { Switch, Route} from 'react-router-dom';
import Login from './login/login.jsx';


function App() {
  return (
    <Fragment>
          <Switch>
          <Route path="/login" component={Login} />
          <Route path="/register" component={Login} />
    </Switch>
    <Nav />
    </Fragment>


  );
}

export default App;
